import { FunctionComponent } from "react";
import { NavLink, useNavigate } from "react-router-dom";

interface NavbarProps {
  setUserInfo: Function;
  userInfo: any;
}

const Navbar: FunctionComponent<NavbarProps> = ({ setUserInfo, userInfo }) => {
  let navigate = useNavigate();
  let render = () => setUserInfo(!userInfo);

  let logout = () => {
    sessionStorage.removeItem("userInfo");
    navigate("/home");
    render();
  };
  return (
    <>
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <div className="container-fluid">
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarTogglerDemo03"
            aria-controls="navbarTogglerDemo03"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <NavLink to={"/home"} className="navbar-brand">
            <img src="/logo.png" alt="" width="60" height="44" />
          </NavLink>
          <div className="collapse navbar-collapse" id="navbarTogglerDemo03">
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
              <li className="nav-item">
                <a className="nav-link active" aria-current="page" href="#">
                  About Sniffle
                </a>
              </li>

              {/**** business user menu****/}
              {userInfo.role === "business" && (
                <li className="nav-item">
                  <a className="nav-link active" aria-current="page" href="/user-cards">
                    My cards
                  </a>
                </li>
              )}
              {(userInfo.role === "business" || userInfo.role === "user") && (
                <li className="nav-item">
                  <NavLink className="nav-link active" aria-current="page" to="favorites">
                    My favorite
                  </NavLink>
                </li>
              )}
            </ul>

            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
              {!userInfo.role && (
                <>
                  <li className="nav-item">
                    <NavLink className="nav-link" to={"/login"}>
                      Login
                    </NavLink>
                  </li>
                  <li className="nav-item">
                    <NavLink className="nav-link" to={"/register"}>
                      Register
                    </NavLink>
                  </li>
                </>
              )}
              {/***** only registered user *******/}
              {userInfo.firstName && (
                <>
                  <li className="nav-item">
                    <NavLink className="nav-link" to={"/home"} onClick={logout}>
                      Logout
                    </NavLink>
                  </li>
                  <li className="nav-item">
                    <NavLink className="nav-link" to={"/userProfile"}>
                      <i className="fa-solid fa-user"></i>
                    </NavLink>
                  </li>
                </>
              )}
              {/* <form className="d-flex"> */}
              <div className="input-group md-form form-sm form-2 pl-0">
                <input
                  className="form-control my-0 py-1 lime-border"
                  type="text"
                  placeholder="Search"
                  aria-label="Search"
                />
                <div className="input-group-append">
                  <span className="input-group-text lime lighten-2" id="basic-text1">
                    <i className="fas fa-search text-grey" aria-hidden="true"></i>
                  </span>
                </div>
              </div>
              {/* </form> */}
            </ul>
          </div>
        </div>
      </nav>
    </>
  );
};

export default Navbar;
